広告文責/販売会社:株式会社Hanbit TEL:050-1040-7307<br><br><br><br>本商品はお取り寄せ商品のため、稀にご注文入れ違い等により欠品・遅延となる場合がございます。誠に恐れ入りますが、何卒ご了承ください。<br>また、以下の場合には追加送料がかかる場合がございます。<br><br>・沖縄、離島および一部地域への配送時<br>・同梱区分が異なる商品の複数購入時<br><br>【出荷目安】：<b>1 - 4営業日　※土日・祝除く</b><br>【同梱区分】：<b>TS 1957</b><br>【梱包サイズ】：<b>通常商品</b><br><br><br><hr><br><font size="+2">■本商品のサイズ、色違い、関連商品はこちら</font><br><br><hr><br><font color="red"><b>商品内容</b></font><br><br>10.0オンスのヘビーウェイトの裏起毛フルジップパーカーです。<br>スウェット裏起毛は、裏パイルの編み物をひっかき，毛羽立せた生地です。<br>その結果、生地は厚みを増しボリューム感を与えます。柔らかな感触を持ち、保温性が高くなります。<br>素材を、綿52％、ポリエステル48％と、天然素材で肌触りの良い綿と、速乾のポリエステルのブレンドで、手放せない温かさを実現しました。<br>シンプルなデザインなので、インナー・アウターと遊ぶ普段着や、リラックスできる部屋着としてなど、多シーンで着こなせます。<br>フードは二重縫製です。<br>レディスサイズ150ｃｍからメンズＸＬまで5サイズ用意しました。<br><br><hr><br><font color="red"><b>商品スペック</b></font><br><br>【ブランド】<br>　バリエンテ<br>【商品名】<br>　肌触りにこだわった「裏起毛」プルパーカー<br>【型番】<br>　CB5618<br>【材質】<br>　裏起毛綿52％ポリエステル48％<br>【生産国】<br>　中国<br>【サイズ】<br>《150ｃｍサイズ》<br>　着丈/約58cm<br>　袖丈/約53cm<br>　身幅/約47cm<br>　肩幅/約40ｃｍ」<br>《Sサイズ》<br>　着丈/約62cm<br>　袖丈/約57cm<br>　身幅/約52cm<br>　肩幅/約44ｃｍ<br>《Mサイズ》<br>　着丈/約66cm<br>　袖丈/約60cm<br>　身幅/約55cm<br>　肩幅/約48ｃｍ<br>《Lサイズ》<br>　着丈/約70cm<br>　袖丈/約61cm<br>　身幅/約58cm<br>　肩幅/約52ｃｍ<br>《ＸLサイズ》<br>　着丈/約75cm<br>　袖丈/約62cm<br>　身幅/約63cm<br>　肩幅/約55ｃｍ<br>※適応サイズではございません。目安となる実寸サイズとなります。<br>【カラー】<br>　レッド、バーガンディー、パープル、ロイヤルブルー、オリーブ、ヘザーグレー、セメント、ダークブラウン、ネイビー、ブラック<br>【スペック】<br>　フード（取り外し不可）<br>【特記事項】<br>サイズ違いによる返品・交換はお受け出来ません。予めご了承下さい。<br><br>弱洗濯４０度可　塩素系洗剤不可　中アイロン　タンブラー乾燥不可　陰干し<br>【注意事項】<br>　<br><br><br><br><hr><br><font size="+2">■本商品のサイズ、色違い、関連商品はこちら</font><br><style type="text/css">
